import {css, html, LitElement} from 'https://unpkg.com/lit?module';
import { unsafeHTML } from "https://cdn.jsdelivr.net/npm/lit-html@2.6.1/directives/unsafe-html.js";
const getTheme = () => localStorage.getItem('theme') ?? window.matchMedia('(prefers-color-scheme: dark)').matches ? 'dark' : 'light'

class CasBannerCta extends LitElement {
  constructor() {
    super();
    this.theme = getTheme();
  }

  static get styles() {
    return css`
      :host {
        display: block;
        background-color: rgba(242, 245, 249, 0.23);
        transition: all .3s ease-in-out;
      }
      [data-theme="dark"] {
        background-color: #364855;
        color: #FFFFFF;
      }

      section {
        display: flex;
        justify-content: center;
        width: 100%;
        color: #203442;
      }

      .inner-container {
        max-width: 1264px;
        padding: 90px 32px 0;
        flex: 1;
        display: grid;
        grid-template-columns: 1fr 1fr;
        gap: 64px;
      }

      .logo-text {
        position: relative;
        margin-left: 8px;
      }

      .logo-text::after {
        content: "";
        position: absolute;
        top: 0;
        left: 0;
        display: block;
        background: var(--logo-banner-cta) no-repeat center center;
        background-size: 100%;
        width: 270px;
        height: 48px;
      }

      .logo-text::after svg {
        width: 100%;
        height: 100%;
      }

      .platforms {
        display: flex;
        padding: 16px 0;
        color: #4D5D68;
        margin-top: 16px;
      }
      
      [data-theme="dark"] .platforms {
        color: #FFFFFF;
      }

      .platforms .item {
        padding: 16px 32px;
        display: flex;
        align-items: center;
        gap: 12px;
        color: currentColor;
      }

      .platforms .item:first-child {
        border-right: 2px solid #F2F5F9;
      }

      .graph {
        display: flex;
        justify-content: flex-end;
        align-items: end;
      }

      .graph .image {
        width: max-content;
        max-width: 360px;
      }

      .graph .apps {
        display: flex;
        flex-direction: column;
        gap: 8px;
        padding: 60px 0;
      }

      @media (max-width: 1024px) {
        .inner-container {
          display: flex;
          flex-direction: column;
          padding: 50px 16px 0;
          gap: 16px;
        }

        .logo-text::after {
          width: 192px;
          height: 34px;
        }

        .platforms {
          margin-top: 0;
        }

        .graph {
          justify-content: center;
          align-items: center;
        }

        .graph .image {
          max-width: 188px;
        }
      }
    `;
  }

  static get properties() {
    return {
      theme: {type: String},
      tag: {type: String},
      title: {type: String},
      description: {type: String},
      logo: {type: String},
      image: {type: String},
      web: {type: String},
      ios: {type: String},
      android: {type: String},
    };
  }

  firstUpdated() {
    if (!localStorage.getItem('theme')) {
      window.matchMedia('(prefers-color-scheme: dark)').addEventListener('change', e => {
        this.theme = e.matches ? 'dark' : 'light'
      })
    }
  }

  render() {
    console.log(this.theme)
    return html`
        <style>
            :host {
                --logo-banner-cta: url(${this.logo});
            }
        </style>
        <section data-theme="${this.theme}">
            <div class="inner-container">
                <div class="info">
                    <cas-text variant="headline5" mobileVariant="m-body2">${this.tag}</cas-text>
                    <cas-text variant="display2" mobileVariant="m-display3">${unsafeHTML(this.title)}<span
                            class='logo-text'></span></cas-text>
                    <cas-text variant="headline5" mobileVariant="m-body1">${this.description}</cas-text>
                    <div class="platforms">
                        <a class="item" href="${this.web}" target="_blank" rel="noopener noreferrer">
                            ${iconWeb}
                            <cas-text variant="body1">Web</cas-text>
                        </a>
                        <div class="item">
                            ${iconApp}
                            <cas-text variant="body2">App</cas-text>
                        </div>
                    </div>
                </div>
                <div class="graph">
                    <img class="image" src="${this.image}" alt="${this.title}"/>
                    <div class="apps">
                        <a href="${this.ios}" target="_blank" rel="noopener noreferrer">${logoAppStore}</a>
                        <a href="${this.android}" target="_blank" rel="noopener noreferrer">${logoGooglePlay}</a>
                    </div>
                </div>
            </div>
        </section>
    `;
  }
}

customElements.get("cas-banner-cta") ||
customElements.define("cas-banner-cta", CasBannerCta);


